import 'bootstrap/dist/css/bootstrap.min.css';

const StickyBin = () => {
  return (
    <div className="sticky-bin-container">

        <div className="row">
          {/* Main content */}
          <div className="col-md-8">
            {/* Your main content here */}
          </div>

          {/* Sticky bin */}
          <div className="col-md-4">
            <div className="sticky-bin">
              <h3>Your Bin</h3>
              {/* Your bin items here */}
            </div>
          </div>
        </div>
      </div>
  );
};

export default StickyBin;
